def uncool( P ):
    n = len(P)
    # Dodajemy indeksy do przedziałów
    for i in range(n):
        P[i].append(i)

    # Sortujemy przedziały po początkowej wartości, a następnie po końcowej
    P_sorted = sorted(P, key=lambda x: (x[0], x[1]))

    # Szukanie niefajnej pary po sąsiadach
    for i in range(n - 1):
        a, b = P_sorted[i][0], P_sorted[i][1]
        c, d = P_sorted[i + 1][0], P_sorted[i + 1][1]

        # Sprawdzenie, czy przedziały są niefajne
        if c != a and c < b and d > b:
            return (P_sorted[i][2], P_sorted[i + 1][2])

    # Jeśli nie znaleziono niefajnej pary w sąsiadach, przeszukaj każdy z każdym
    for i in range(n):
        for j in range(i + 1, n):
            a, b = P_sorted[i][0], P_sorted[i][1]
            c, d = P_sorted[j][0], P_sorted[j][1]

            # Sprawdzanie, czy przedziały są niefajne
            if c != a and c < b and d > b:
                return (P_sorted[i][2], P_sorted[j][2])

            # Jeśli przedziały są rozłączne, można przerwać wewnętrzną pętlę
            if b < c:
                break

    # W przypadku gdyby mimo wszystko nie znaleziono niefajnej pary (choć zakładamy, że taka istnieje)
    return None


